import React from 'react';
import logo from './logo.svg';
import './App.css';

state = {
  list: [
  {text: "Buy eggs", done: false},
  {text: "Buy milk", done: true},
  ]
  }

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className = "todo-list">
          <ul>
          {this.state.list.map((todo,index)=>
              <li>{todo}</li>

            )}

          </ul>
        </div>
      </header>
    </div>
  );
}

export default App;
